import React from 'react';
import {BrowserRouter, Switch, Route} from 'react-router-dom'
import SubjectPage from './Pages/SubjectPage'
import HomePage from './Pages/HomePage'

export default function App() {


  return (
    <BrowserRouter>
      <Switch>
        <Route path= '/subject'>
         <SubjectPage/>
        </Route>
        <Route path='/'>
          <HomePage/>
        </Route>
      </Switch>
    </BrowserRouter>
  );
}
